import React, { useState } from 'react';
import './portfolio.css';
import Menu from './Menu';

const Portfolio = () => {
  const [items, setItems] = useState(Menu);

  return (
    <section className='work container section' id='work'>
      <h2 className='section_title'>Recent Works</h2>

      <div className='work_filters'>
        <span className='work_item'>Everything</span>
        <span className='work_item'>Live Projects</span>
        <span className='work_item'>React Js</span>
        <span className='work_item'>Next Js</span>
        <span className='work_item'>Vanilla JavaScript</span>
      </div>

      <div className='work_container grid'>
        {items.map}
      </div>
    </section>
  )
}

export default Portfolio
